import React, { useState } from 'react';
import { makeStyles } from '@mui/styles';
import { Typography, Grid, Box, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const honeyTypes = [
    {
      id: 1,
      name: 'Akác',
      description: 'Leírás Akác mézről',
      price: 1000,
      image: 'https://via.placeholder.com/200'
    },
    {
      id: 2,
      name: 'Gyógy',
      description: 'Leírás Gyógy mézről',
      price: 1200,
      image: 'https://via.placeholder.com/200'
    },
    {
      id: 3,
      name: 'Hárs',
      description: 'Leírás Hárs mézről',
      price: 1500,
      image: 'https://via.placeholder.com/200'
    },
    {
      id: 4,
      name: 'Virág',
      description: 'Leírás Virág mézről',
      price: 800,
      image: 'https://via.placeholder.com/200'
    },
    {
      id: 5,
      name: 'Repce',
      description: 'Leírás Repce mézről',
      price: 900,
      image: 'https://via.placeholder.com/200'
    }
  ];

const useStyles = makeStyles(() => ({
  root: {
    backgroundColor: 'white',
    padding: '20px',
  },
  item: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    margin: '20px',
  },
  image: {
    height: '200px',
    width: '200px',
    marginBottom: '10px',
  },
}));

const List = ({ onAddToCart }) => {
  return (
    <>
      <Typography variant="h4" gutterBottom>
        Products
      </Typography>
      <MuiList>
        {products.map((product) => (
          <ListItem key={product.id}>
            <ListItemAvatar>
              <Avatar src={product.image} />
            </ListItemAvatar>
            <ListItemText primary={product.name} secondary={`${product.price.toFixed(2)} HUF`} />
            <IconButton onClick={() => onAddToCart(product)}>
              <AddShoppingCartIcon />
            </IconButton>
          </ListItem>
        ))}
      </MuiList>
    </>
  );
};

export default List;
